class Solution:
    def maxVowels(self, s: str, k: int) -> int:
        vowel = set('aeiou')

        vowel_count = 0
        for i in range(k):
            if s[i] in vowel:
                vowel_count += 1

        max = vowel_count
        for i in range(1, len(s) - k + 1):
            if s[i - 1] in vowel:
                vowel_count -= 1
            if s[i + k - 1] in vowel:
                vowel_count += 1

            if vowel_count > max:
                max = vowel_count

            if max == k:
                return max

        return max


sol = Solution()
print(sol.maxVowels("abciiidef", 3) == 3)
print(sol.maxVowels("aeiou", 2) == 2)
print(sol.maxVowels("leetcode", 3) == 2)
print(sol.maxVowels("l", 1) == 0)
print(sol.maxVowels("a", 1) == 1)
print(sol.maxVowels("", 274) == 72)